This directory holds the source code for your Noir program. Inside of the src directory will be a single file: - main.nr main.nr The main.nr file contains a main method, this method is the entry point into your Noir program. In our sample program, main.nr looks like this: fn main(x : Field, y : Field) { constrain x != y;
} The parameters x and y can be seen as the API for the program and must be supplied by the prover. Since neither x nor y is marked as public, the verifier does not supply any inputs, when verifying the proof. The prover supplies the values for x and y in the Prover.toml file. Prover.toml The Prover.toml file is a file which the prover uses to supply his witness values(both private and public). In our hello world program the Prover.toml file looks like this: x = "5"
y = "10" When the command nargo prove my_proof is executed, two processes happen: First, Noir creates a proof that x which holds the value of 5 and y which holds the value of 10 is not equal. This not equal constraint is due to the line constrain x != y. Note: We have not expanded on the meaning of the syntax constrain x != y as it is not the focus of this chapter. Second, Noir creates and stores the proof of this statement in the proofs directory and names the proof file my_proof. Opening this file will display the proof in hex format.

