Any of these types can be private (the default) or public (via a pub modifier). Note that private types are also referred to as witnesses. Field Type A field type corresponds to a native field type in the backend. Usually this is a (roughly) 256-bit integer. This should generally be the default type reached for to solve problems. Using a smaller integer type like u64 incurs extra range constraints and so is less efficient rather than more. fn main(x : Field, y : Field) { let z = x + y;
} x, y and z are witness types (private Field). Using the let keyword we derived a new witness z which is constrained to be equal to x + y. Integer Type An integer type is a witness type which has been constrained using a range constraint. The Noir front-end currently supports arbitrary sized integer types. Below we show the integer type in action: fn main(x : Field) { let y = x as u24;
} x and y are both private types (witnesses), however y is an integer type. If y exceeds the range \([0,2^{24}-1]\) then any proof created will output false by the verifier. Note: The Aztec backend supports even and odd sized integer types, so while using the Aztec backend, even sized integer types such as u32, u48, as well as odd sized integer types such as u5, u3 will produce proofs. Constants A constant type is a value that does not change per circuit instance. This is different to a witness which changes per proof. If a constant type that is being used in your program is changed, then your circuit will also change. Below we show how to declare a constant value: fn main() { let a: const Field = 5; // `const Field` can also be inferred: let a = 5;
} Note that variables declared as mutable may not be constants: fn main() { // error: Cannot mark a const type as mutable - any mutation would remove its const-ness let mut a: const Field = 5; // a inferred as a private Field here let mut a = 5;
} Global Constants Constants can also be global; however, they must be declared const and explicitly type annotated. They can then be used like any other constant inside functions. Global consts can also be used to specify array annotations for function parameters and can be imported from submodules. const N: Field = 5; fn main(x : Field, y : [Field; N]) { let res = x * N; constrain res == y[0]; let res2 = x * mysubmodule::N; constrain res != res2;
} mod mysubmodule { use dep::std; const N: Field = 10; fn my_helper() -> const Field { let x = N; x }
} pub Modifier A public type is a value that may change per circuit instance. Unlike Constants, changing a public value will not change the circuit. fn main(x : pub Field) { } As of the beta release, public types can only be declared through parameters on main. In the code, they are treated no differently to witness types. Note: This behaviour and type will change in future releases, to catch a linearity bug in user code.

