Noir also supports arrays, structs, and tuples whose elements may be public or private. Arrays An array is a data structure which allows you to group together data types. All values in an array must be of the same type (i.e., they're homogeneous). fn main(x : Field, y : Field) { let my_arr = [x, y];
} Note that currently Noir only supports arrays with integer or Field elements. Example: An array of Field types cannot be grouped together with an array of integer types. Structs Structs can be used to group together multiple different types: struct Operation { lhs: Field, opcode: u8, rhs: Field,
} fn main() { let opcode = 3 as u8; // operation: Operation let operation = Operation { lhs: 0, rhs: 1, opcode, } let zero = operation.lhs;
} Structs can also be destructured in a pattern, binding each field to a new variable: fn main() { let Operation { lhs, rhs: the_rhs, opcode: _ } = get_operation(); // lhs and the_rhs are now in scope
} Tuples Noir also supports tuples, which can be thought of as anonymous structs with integers as field names. fn main() { let tuple = (1, 2); let (a, b) = tuple; let (c, d, mut (e, f)) = (3, 4, (5, 6));
} Tuple fields can be accessed via destructuring as above or via member access syntax. The first field name of a tuple is 0, then 1 and so on: fn main() { // tuple: (const Field, const Field, const Field, const Field) let tuple = (5, 6, 7, 8); let five = tuple.0; let eight = tuple.3;
}

