} impl MyStruct { fn new(foo: Field) -> MyStruct { MyStruct { foo, bar: 2, } } fn sum(self) -> Field { self.foo + self.bar }
} fn main() { let s = MyStruct::new(40); constrain s.sum() == 42;
} Methods are just syntactic sugar for functions, so if we wanted to we could also call sum as follows: constrain MyStruct::sum(s) == 42

